#define Y_NWSRT_SWP2(I,J) { const unsigned II = I; const unsigned JJ = J; T &aI = a[II]; T &aJ = a[JJ]; if(aJ<aI) { core::bswap< sizeof(T) >( &aI, &aJ ); core::bswap< sizeof(U) >( &b[II],&b[JJ]); } }
